import React from "react";
import PageTitle from "../components/Typography/PageTitle";
import { Card, CardBody } from "@windmill/react-ui";
import RoundIcon from "../components/RoundIcon";
import InfoCard from "../components/Cards/InfoCard";
import { FaBook, FaCode, FaDatabase } from "react-icons/fa";

const courses = [
  {
    icon: <FaBook />,
    name: "Computer Architecture",
    facultyname: "Sathya P"
  },
  {
    icon: <FaCode />,
    name: "Data Structures",
    facultyname: "John Smith"
  },
  {
    icon: <FaDatabase />,
    name: "Database Management Systems",
    facultyname: "Emily Brown"
  }
];

function MyCourse() {
  return (
    <>
      <PageTitle>MyCourse</PageTitle>
      <Card className="mb-8 shadow-md">
        <CardBody>
          <div className="grid gap-6 m-8 md:grid-cols-2 xl:grid-cols-4">
            {courses.map((course, index) => (
              <InfoCard
                key={index}
                title={course.name}
                value={`Faculty: ${course.facultyname}`}
              >
                <RoundIcon
                  icon={course.icon}
                  iconColorClass="text-orange-500 dark:text-orange-100"
                  bgColorClass="bg-orange-100 dark:bg-orange-500"
                  className="mr-4"
                />
              </InfoCard>
            ))}
          </div>
        </CardBody>
      </Card>
    </>
  );
}

export default MyCourse;
